import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 24.2-646 Voter folds paper ballot and hands same to officer who deposits it unopened in ballot container.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-646.md","filePath":"vacode/24.2-646.md"}'),n={name:"vacode/24.2-646.md"},i=o('<h1 id="§-24-2-646-voter-folds-paper-ballot-and-hands-same-to-officer-who-deposits-it-unopened-in-ballot-container" tabindex="-1">§ 24.2-646 Voter folds paper ballot and hands same to officer who deposits it unopened in ballot container. <a class="header-anchor" href="#§-24-2-646-voter-folds-paper-ballot-and-hands-same-to-officer-who-deposits-it-unopened-in-ballot-container" aria-label="Permalink to &quot;§ 24.2-646 Voter folds paper ballot and hands same to officer who deposits it unopened in ballot container.&quot;">​</a></h1><p>The qualified voter shall fold each paper ballot with the names of the candidates and questions on the inside and hand the folded ballot to the appropriate officer of election. The officer shall place the ballot in the ballot container without any inspection except to assure himself that only a single ballot has been tendered and that the ballot is a genuine ballot. Without looking at the printed inside of the ballot, the officer may inspect the official seal on the back of the ballot to determine if it is genuine.</p><p>Code 1950, § 24-247; 1970, c. 462, § 24.1-131; 1993, c. 641; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP1015" target="_blank" rel="noreferrer">1015</a>; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0540" target="_blank" rel="noreferrer">540</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0576" target="_blank" rel="noreferrer">576</a>.</p>',3),l=[i];function r(s,d,c,h,p,f){return t(),a("div",null,l)}const u=e(n,[["render",r]]);export{b as __pageData,u as default};
